INSERT INTO `student_resumes` (`id`, `student_id`, `objective`, `skills`, `education`, `experience`, `projects`, `certifications`, `languages`, `hobbies`, `theme`, `created_at`, `updated_at`) VALUES
(1, 149, 'To secure a responsible and growth-oriented position where I can utilize my skills in Web Development and backend technologies to contribute effectively to organizational goals, while gaining valuable experience and insights that will help me establish my own software company and manage large-scale, impactful software projects in the future.', 'Frontend Development: HTML CSS JavaScript , Backend & Databases: PHP  Node.js SQL,  Programming Languages: C  Python,  UI/UX & Design Tools: Figma, Android UI Design, iOS UI Design', 'Bachelor of Technology (B.Tech)  [NIT]\r\nYear: 2025\r\nHigher Secondary Education (12th)  [Concept School]\r\nYear: 2024-25\r\nSecondary School (10th)  [TIPS Katol]\r\nYear: 2023-24', '2 year experience\r\nWorked on web development and programming tasks, contributing to real-time project modules.', ' Projects\r\n1. Web Development Project\r\nTechnologies: HTML, CSS, JavaScript, PHP\r\nDescription: Developed a fully responsive and dynamic website featuring user authentication, interactive forms, and real-time content updates. Implemented secure login, optimized UI/UX, and improved overall performance.\r\n2. Website Design Project\r\nTechnologies: HTML, CSS, UI/UX Design\r\nDescription: Designed a modern and visually appealing website layout with focus on user experience, color harmony, responsive structure, and intuitive navigation.\r\n3. Software Design Project\r\nTechnologies: Java / Python / Any tool you used\r\nDescription: Designed a software solution from planning to prototype stage, including system flow, user requirements, interface design, and basic functionality planning.', 'I am beyond excited to share that I have successfully completed HTML, CSS, JavaScript, QA, and SQL, and have officially earned my certification! This journey has been a truly enriching experience, allowing me to develop new skills, overcome challenges, and grow both technically and professionally.\r\nReceiving this certificate is a moment of immense joy and prideit reflects my dedication, perseverance, and passion for learning! \r\nA heartfelt thank you to Enjoy Programming for their incredible support, insightful guidance, and motivation throughout this learning journey. Their expertise has been instrumental in my growth, and I am truly grateful.\r\nThis achievement is just the beginning! I am eager to put my knowledge into action, take on new challenges, and continue evolving in the dynamic world of web development! \r\nhashtag#MilestoneAchieved hashtag#CertifiedDeveloper hashtag#Grateful hashtag#KeepLearning hashtag#ExcitedForTheFuture', 'English, Hindi, Marathi', 'Coding and exploring new technologies  Designing software and creating user-friendly interfaces  Web design and creative layout work  Problem-solving and logical thinking activities  Learning new programming skills and tools', 'creative', '2025-12-02 07:33:28', '2025-12-02 08:28:23'),
(2, 39, 'grrgg', 'dsv', 'dsvdfvfd', 'dvdfv', 'dvv', 'dsvdvs', 'dsds', 'dvdsvdvds', 'creative', '2025-12-02 08:05:58', '2025-12-02 08:05:58'),
(3, 163, 'To secure a responsible and growth-oriented position where I can utilize my skills in Web Development, to contribute effectively to organizational goals while continuously improving my professional knowledge.', 'HTML,CSS,JS ,C', 'Bachelor of Technology (B.Tech)  [NIT]\r\nYear:2025\r\nHigher Secondary Education (12th)  [Concept School]\r\nYear:2023-25\r\nSecondary School (10th)  [AIPS]\r\nYear: 2023', '1 Year Experience\r\nWorked on web development and programming tasks, contributing to real-time project modules.', 'Web Development Project\r\nTechnologies: HTML, CSS, JavaScript\r\nDescription: Developed a responsive website', 'Web Development Certification', 'English, Hindi, Marathi', 'Reading, Coding, Sports', 'creative', '2025-12-02 12:20:56', '2025-12-02 12:21:21');
